import { Button, Input } from "antd";
import React from "react";

const Login = () => {
return(
    <div>
        <div>Login</div>
        <div>Signup</div>
        <span>Email</span> <Input />
        <span>Password</span> <Input />
        <Button></Button>
    </div>
)
};

export default Login;
